import "./Expenses.css";
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
  return expenses.map((expense, index) => (
    <ExpenseItem
      key={index}
      title={props.expense.title}
      amount={props.expense.amount}
      date={props.expense.date}
    />
  ));
}

export default Expenses;
